import React, { useState } from 'react';
import styled from 'styled-components';
import Card from './Card';

const CardsContainer = styled.div`
  flex-grow: 1;
  padding-top: 40px;
  text-align: center;
  display: flex;
  justify-content: center;
  align-items: flex-end;
  z-index: 1;
`;

function Cards({ available, setMySelections }) {
  const players = available.map((player) => {
    <Card id={player.id} type={player.type} wildCard={player.wildCard} setMySelections={setMySelections} />
  })

  return (
    <CardsContainer>
      {players}
    </CardsContainer>
  );
}

export default Cards;
